import React from "react";
import IntlMessages from "../../../../../../util/IntlMessages";
import Fab from "@material-ui/core/Fab";
import { connect } from "react-redux";
import DeleteOutlineIcon from "@material-ui/icons/DeleteOutline";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import GroupesItem from "./GroupesItem"
class ArchiveGroupes extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const { groupsList  } = this.props;
    return (
      <div>      
          <div>
          <h1>
            <b>
              <IntlMessages id="service.button.archive" />
            </b>
          </h1>
        </div>
        <br />
        <Table className="default-table table-unbordered table table-sm table-hover">
          <TableHead className="th-border-b">
            <TableRow>
              <TableCell>
                {" "}
                <IntlMessages id="sidebar.components.groupes" />
              </TableCell>
              <TableCell>
                {" "}
                <IntlMessages id="sidebar.components.class" />{" "}
              </TableCell>
              <TableCell>
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {groupsList.map((levelItem) => {
              return (
                <GroupesItem
                // handleDearchiver={this.props.handleDearchiver}
                archived={true}
                // levelItem={levelItem}
                // handleEdit={this.handleEdit}
                // handleDelete={this.handleDelete}
                // educationTypes={this.props.educationTypes}
              />
              );
            })}
          </TableBody>
        </Table>
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    // archivedLevels: state.levelsReducer.archivedLevels,
  };
};

export default connect(mapStateToProps)(ArchiveGroupes);
